INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(1, 'El Libro del Crimen Pasta dura – 1 abril 2019', 578, 10, '¿Cómo se ganó Jack el Destripador su siniestro nombre? ¿Quién \"vendió\" la Torre Eiffel? ¿Cómo se llevó a cabo el atraco del Hatton Garden? Este libro responde estas y otras muchas preguntas mediante el análisis de las estafas, los robos y los asesinatos más infames de la historia.Tan documentado como cautivador, con un texto absorbente y sugerentes ilustraciones, El Libro del Crimen aporta una nueva perspectiva sobre el crimen y la criminología. Desde los piratas y los salteadores hasta los asesinos en serie y los ciberdelincuentes del siglo XXI, cada artículo ofrece una mirada sobre la mente criminal y el sistema judicial.Tanto el estudiante de derecho o psicología como el ávido lector de novela criminal encontrará aquí multitud de casos, en ocasiones tan interesantes como sobrecogedoras.', , 'Amazon México', 'Amazon México');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(2, 'Lenovo - 2021 - IdeaPad 3 - Laptop para Juegos - AMD Ryzen 5 5600H - 8 GB de RAM - 256 GB de Almacenamiento - NVIDIA GeForce GTX 1650 - Pantalla FHD de 15.6 Pulgadas - Windows 11 Home', 17256.8, 5, 'Impulsado por el revolucionario procesador móvil AMD Ryzen 5000 serie H, este portátil para juegos IdeaPad ofrece las victorias; con 6 núcleos ultra sensibles, es el nuevo estándar para el rendimiento de juegos en portátiles innovadores, delgados y ligeros\r\nIncluye prueba gratuita de 3 meses de Xbox Game Pass Ultimate. Juega más de 100 juegos de PC de alta calidad en PC con Windows; incluye juegos icónicos de Bethesda, títulos nuevos del día uno y el catálogo de EA Play en PC\r\nPantalla IPS FHD de 15.6 pulgadas (1920 x 1080) con GPU NVIDIA GeForce GTX 1650 para sobrecargar tus juegos favoritos. Dispara tus imágenes de juego con frecuencia de actualización de 120 Hz para juegos sin desgarros\r\nMemoria RAM DDR4 de 8 GB y 3200 MHz y almacenamiento SSD M.2 PCIe de 256 GB\r\n2 altavoces de 2 W con Nahimic Audio para jugadores; espacioso teclado para juegos con retroiluminación blanca; Ethernet RJ45, WiFi 802.11 ax, Bluetooth 5.0; cámara web HD de 720p y matriz de micrófono con obturador de privacidad; HDMI, USB-C\r\nUsar Alexa en tu PC es tan fácil como hacer una pregunta: solo tienes que preguntar y Alexa puede comprobar tu calendario, crear listas, reproducir música, responder preguntas, leer las noticias y mucho más', , 'Amazon Estados Unidos', 'Amazon Estados Unidos');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(3, 'La soledad de los números primos Pasta blanda – 1 junio 2020 (Libros)', 182, 8, 'La novela que convirtió a Paolo Giordano en el fenómeno editorial más relevante de los últimos tiempos en Italia. /B. P Entre los números primos hay algunos aún más especiales. Son aquellos que los matemáticos llaman primos gemelos, pues, aunque permanecen próximos, entre ellos se interpone siempre un número par. P Esta verdad matemática es la hermosa metáfora que el autor ha escogido para narrar la historia de Alice y Mattia, dos personas cuyas vidas han quedado condicionadas por las consecuencias de sendos episodios ocurridos en su niñez. Pese a la fuerte atracción que los une, la vida erigirá entre ellos barreras invisibles que pondrán a prueba la solidez de su relación. P la sutileza de los rasgos psicológicos de los personajes, así como la hondura y complejidad de una historia que suscita en los lectores las reacciones más variadas, resaltan la admirable madurez literaria de este joven autor a la hora de asomarse, nada más y nada menos, a la esencia de la soledad.', , 'Amazon México', 'Amazon México');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(4, 'Acer Swift 3 Laptop delgada y ligera | Pantalla IPS Full HD de 14 pulgadas 100% sRGB | Procesador AMD Ryzen 7 5700U Octa-Core | 8GB LPDDR4X | 512GB NVMe SSD | WiFi 6 | KB retroiluminado | FPR | Amazon Alexa | SF314-43-R2YY', 16625.4, 20, 'Potente productividad: procesador AMD Ryzen 7 5700U Octa-Core con gráficos Radeon ejecuta tus aplicaciones más exigentes con capacidad de respuesta ultrarrápida y un uso de batería hipereficiente para mantenerte productivo y entretenido todo el día\r\nMuy visual: sumérgete en imágenes consistentemente ricas y brillantes en la pantalla panorámica Full HD de 14 pulgadas con retroiluminación LED 100% sRGB con 85.73% pantalla a cuerpo, relación de aspecto 16:9 y biseles estrechos\r\nEspecificaciones internas: memoria integrada LPDDR4X de 8 GB; almacenamiento de unidad de estado sólido NVMe de 512 GB para almacenar tus archivos y medios\r\nWindows Hello con lector de huellas dactilares: lector biométrico de huellas dactilares y opciones de inicio de sesión de Windows Hello ayudan a mantener tu PC Acer seguro\r\nConexiones: 802.11ax Wi-Fi 6 Dual-Band 2.4GHz y 5GHz con tecnología MU-MIMO; Bluetooth 5.2\r\nAcer La tecnología Purified.Voice cuenta con un procesamiento de señal digital mejorado para cancelar el ruido de fondo, mejorar la precisión del habla y la recogida de campo lejano, lo que no solo hace que las llamadas sean más claras, sino que hace que hablar con Alexa sea más fácil que antes.\r\nUsar Alexa en tu PC es tan fácil como hacer una pregunta. Solo tienes que preguntar y Alexa puede comprobar tu calendario, crear listas, reproducir música, responder preguntas, leer las noticias y mucho más.\r\nFresco en todos los sentidos: el chasis de metal muy elegante es ligero y lo suficientemente duradero como para ser tu compañero en movimiento durante todo el día, y la bisagra de elevación discreta ayuda a aumentar el flujo de aire para mantener este portátil Acer Swift con un aspecto y una sensación fresca\r\nPuertos para todos tus accesorios: USB 3.2 tipo C (DisplayPort y carga USB), 2 - USB 3.2 Gen 1 (1 carga de apagado), HDMI 2.0 con soporte HDCP, conector de entrada de auriculares/micrófono, entrada CC para adaptador de CA', , 'Amazon Estados Unidos', 'Amazon Estados Unidos');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(5, 'Asus VivoBook 15 M515 Thin and Light Laptop, 15.6” IPS FHD Display, Windows 10 Home with Free Upgrade to Windows 11, AMD Ryzen 7 5700U, 8GB RAM, 512GB SSD, Fingerprint Reader, Slate Grey, M515UA-EB72', 15530.7, 4, 'Pantalla de bisel IPS Full HD NanoEdge de 15.6 pulgadas con una impresionante relación de pantalla a cuerpo del 83%\r\nPotente procesador AMD Ryzen 7 5700U (caché de 8 m, hasta 4,3 GHz, 8 núcleos)\r\n8GB DDR4 RAM y 512GB PCIe NVMe M.2 SSD y Windows 10 Home\r\nViene con Windows 10 Home y una actualización gratuita a Windows 11 (cuando está disponible1)\r\nLa actualización de Windows 11 se entregará a dispositivos calificados a finales de 2021 a 2022. El tiempo varía según el dispositivo. Algunas características requieren hardware adicional (ver la página web de Microsoft para especificaciones de Windows 11, características y requisitos de computadora)\r\nSeguridad Windows Hello con sensor de huellas dactilares\r\nConexiones completas que incluyen USB 3.2 tipo A (Gen1), USB 3.2 tipo C (Gen1), USB 2.0 y HDMI\r\nWi-Fi 5 de doble banda ultrarrápida (802.11ac) te mantiene conectado a través de cualquier congestión o interferencia', , 'DCS Store', 'DHL México');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(6, 'Arctic MX-4 2019 - Pasta térmica compuesta para refrigeradores | Pasta para el disipador de calor | Compuesto por micropartículas de carbono | Fácil de aplicar | Alta durabilidad - 4 grams', 289, 15, 'Calidad bien probada: el diseño de nuestros envases de pasta térmica ha cambiado varias veces, la fórmula de la composición se ha mantenido sin cambios, por lo que nuestras pastas MX han sido sinónimo de alta calidad\r\nExcelente rendimiento: la pasta térmica ARCTIC MX-4 está hecha de micropartículas de carbono, lo que garantiza una conductividad térmica extremadamente alta. Esto garantiza que el calor de la CPU/GPU se disipe rápida y eficientemente\r\nAplicación segura: el MX-4 es conductor sin metal y no eléctrico que elimina cualquier riesgo de causar cortocircuitos, añadiendo más protección a la CPU y tarjetas VGA\r\nAlta durabilidad: a diferencia del compuesto térmico de metal y silicona, el MX-4 no compromete con el tiempo. Una vez aplicado, no es necesario volver a aplicarlo, ya que durará al menos 8 años\r\nFácil de aplicar: con una consistencia ideal, el MX-4 es muy fácil de usar, incluso para principiantes', , 'Amazon México', 'Amazon México');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(7, 'Acer Nitro 5 AN515-55-53E5 Laptop Gaming | Intel Core i5-10300H | GPU NVIDIA GeForce RTX 3050 | Pantalla IPS de 15,6\" FHD 144Hz | 8GB DDR4 | SSD NVMe de 256GB | Intel Wi-Fi 6 | Teclado retroiluminado', 20199, 12, 'Domina el juego: Con el procesador Intel Core i5-10300H de 10ª generación, tu Nitro 5 está repleto de una potencia increíble para todos tus juegos\r\nEl ajuste correcto: 14.3 pulgadas de ancho x 10.0 pulgadas de profundidad x 0.95 pulgadas de alto; 5 libras; garantía limitada de un año de viajeros internacionales (ITW); hasta 11 horas de duración de la batería\r\nRTX, está encendido: La última NVIDIA GeForce RTX 3050 (4 GB dedicada GDDR6 VRAM) está impulsada por una arquitectura galardonada con nuevos núcleos de trazado de rayos, núcleos Tensor y multiprocesadores de transmisión que soportan DirectX 12 Ultimate para el máximo rendimiento de juego\r\nIntensidad visual: Explora mundos de juegos con detalles Full HD en la pantalla panorámica IPS retroiluminada por LED de 15.6 pulgadas con resolución de 1920 x 1080, frecuencia de actualización de 144 Hz y 80% de pantalla a cuerpo, relación de aspecto 16:9\r\nEspecificaciones internas: Memoria DDR4 de 8 GB de 2933 MHz (2 ranuras DDR4 en total, máximo 32 GB); SSD NVMe de 256 GB (2 ranuras PCIe M.2, 1 bahía de disco duro de 2.5 pulgadas disponible)\r\nPrioriza tu juego: Killer Ethernet E2600 e Intel Wi-Fi 6 AX201 te da una ventaja en línea tomando el control de tu red y priorizando tu juego\r\nMantente fresco bajo presión: Cuando el uso intensivo requiere un impulso adicional, la tecnología Acer CoolBoost aumenta la velocidad del ventilador en un 10% y la CPU, la refrigeración GPU en un 9% en comparación con el modo automático, aumentando el rendimiento térmico en un 25% para una mejor comodidad de juego', , 'DCS Store', 'DHL México');
