(8, 'Dell G5 5510 - Laptop 15.6\" Ci5 10a,Gen, 8GB RAM, 256GB SSD, Nvidia GTX 1650, Win 11, Negro', 20155.5, 5, '10th Generation Intel Core i5-10500H (12MB Cache, up to 4.5 GHz, 6 cores)\r\n8GB DDR4 2933MHz\r\n256GB CL35 M.2 SSD\r\n(1) headset (headphone and microphone combo) port, (1) HDMI 2.0 port, RJ45 port, (1) USB 2.0 port with PowerShare, (1) USB 2.0 port, (1) USB 3.2 Gen 1 port', , 'Amazon Estados Unidos', 'Amazon Estados Unidos');
