(9, 'Moto E7 i Power, Azul, Smartphone de 6.5\", Android 10.0 Q (Go), Equipo Desbloqueado, Cámara Trasera 13MP + 2MP (Macro) + Cámara Frontal 5 MP', 2419, 6, 'Moto E7i power, Azul\r\nCámara trasera 13MP + 2MP (macro) + Cámara Frontal 5 MP, Zoom de 4X, single LED flash, Procesador 8 Núcleos + 2 GB RAM\r\nProcesador Unisoc, SM 6115, Octacore, Tiger SC9863A, modelo IMG8322 @ 550MHz\r\npantalla de 6.5\" resolución , 720 x 1600, 269 ppi, pantalla LTPS, color 16M, protección panda Glass\r\nbateria Lithium Ion, 5,000 mAh', , 'Amazon México', 'Amazon México');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(10, 'El fin de la eternidad / The End of Eternity Libro de bolsillo – 30 septiembre 2005', 230.19, 20, 'En el siglo XXVII, la Tierra funda una organización llamada Eternidad, enviando sus emisarios al pasado y al futuro para abrir el comercio entre las diferentes épocas, y para alterar la larga y a veces trágica historia de la raza humana. El proyecto estaba integrado sólo por los mejores y más brillantes exponentes de cada siglo: personas que dejaron de lado sus propias vidas para dedicarse a servir a los demás.\r\n\r\nPara hombres como Andrew Harlan, Eternidad representaba mucho más que un trabajo: era su vida, su amante, sus hijos, su familia. Pero, cuando viajó al siglo cuatrocientos ochenta y dos, no pudo evitar enamorarse perdidamente de una hermosa no-eterna llamada Noÿs Lambent. Ahora, perseguidos por una burocracia todopoderosa, Harlan y su amada escapan entre los siglos, buscando romper todas las reglas que sean necesarias para preservar su futuro juntos. Incluso si para ello tuvieran que destruir la propia Eternidad...', , 'Amazon México', 'Amazon México');
INSERT INTO `productos` (`ID`, `nombre`, `precio`, `cantidad`, `descripcion`, `imagen`, `Vendido`, `Envio`) VALUES
(11, 'Fahrenheit 451 (Libro Pasta blanda – 1 enero 2019)', 199, 4, 'Un clásico de la ciencia ficción.\r\nFahrenheit 451 cuenta la historia de un sombrío y horroroso futuro.Montag, el protagonista, pertenece a una extraña brigada de bomberos cuya misión, paradójicamente, no es la de sofocar incendios, sino la de provocarlos para quemar libros.Porque en el país de Montag está terminantemente prohibido leer.Porque leer obliga a pensar, y en el país de Montag está prohibido pensar.Porque leer impide ser ingenuamente feliz, y en el país de Montag hay que ser feliz a la fuerza.', , 'Amazon México', 'Amazon México');

